CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetEconomicRoutes`(IN tripFixedCost DOUBLE, IN tripMileageCost DOUBLE, IN tripCostMax DOUBLE)
BEGIN
    DECLARE fixedCost DOUBLE;            
    DECLARE mileageCost DOUBLE;          
    SET fixedCost = tripFixedCost;       
    SET mileageCost = tripMileageCost;   
    
    DROP TABLE IF EXISTS cost;           
                                            
	
    
    CREATE TEMPORARY TABLE cost AS (SELECT `mileage`.`dc_id`, `mileage`.`store_id`, fixedCost + `mileage`.`mileage` * mileageCost AS tripCost
                                    FROM `mini_solution`.`mileage` ORDER BY tripCost ASC);
    
    
    CREATE TEMPORARY TABLE low_cost as (SELECT `dc_id`, `store_id`, `tripCost` FROM cost WHERE `tripCost` <= tripCostMax ORDER BY `tripCost` DESC);
    
    DROP TABLE cost;                     
    
    SELECT * from low_cost;              
    
    DROP TABLE low_cost;
END ;;
DELIMITER ;
