CREATE DEFINER=`root`@`localhost` PROCEDURE `spLimitDCStoreCombos`(IN thisLimit BIGINT(20))
BEGIN
	select dc_id, store_id, (mileage*.75 + 200) as 'cost'
    from mileage
    where (
			select count(*) from mileage as f
            where f.store_id = mileage.store_id and f.mileage <= mileage.mileage
		) <= thisLimit
	order by store_id, mileage;
END ;;
